import React from "react";
import { NavLink } from "react-router-dom";
import home from './images/home.png'
import mydeck from './images/mydeck.png'
import deckbuilder from './images/deckbuilder.png'
import randomdiceroll from './images/randomdiceroll'

function NavBar() {
  return <div className="navbar">

    <NavLink to="/"><img src={home}/></NavLink>
    <NavLink to="/DeckBuilder"><img src={deckbuilder}/></NavLink>
    <NavLink to="/MyDeck"><img src={mydeck}/></NavLink>
    <NavLink to="/RandomDiceRoll">Random Dice Roll</NavLink>

  </div>;
}

export default NavBar;
